import React from 'react'

function ShowVideoList() {
  return (
    <div className='container_ShowVideoGrid'>
      {
        vids?.map(vi=>{
            return(
                <div key={vi._id} className="video_box_app">
                    <ShowVideo vid={vi} />
                </div>
            )
        })
      }
    </div>
  )
}

export default ShowVideoList
